import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
     //发货统计报表(导出)
     OutWareHoustReportExport: {url: '/WmsReceiptService/OutWareHoustReportExport', method: 'post'},
      //发货明细报表(导出)
     OutWareHoustDetailReportExport:{url:'/WmsReceiptService/OutWareHoustDetailReportExport',method:'post'},
     //入库统计报表(导出)
     InWareHouseReportExport:{url:'/WmsReceiptService/InWareHouseReportExport',method:'post'},
     //入库明细报表(导出)
     InWareHouseDetailReportExport:{url:'/WmsReceiptService/InWareHouseDetailReportExport',method:'post'},
     //调拨统计报表(导出)
     AllocationReportExport:{url:'/WmsReceiptService/AllocationReportExport',method:'post'},
     //调拨明细报表(导出)
     AllocationDetailReportExport:{url:'/WmsReceiptService/AllocationDetailReportExport',method:'post'},


     //发货统计报表(分页)
     OutWareHoustReportPage: {url: '/WmsReceiptService/OutWareHoustReportPage', method: 'post'},
      //发货明细报表(分页)
      OutWareHoustDetailReportPage:{url:'/WmsReceiptService/OutWareHoustDetailReportPage',method:'post'},
     //入库统计报表(分页)
     InWareHouseReportPage:{url:'/WmsReceiptService/InWareHouseReportPage',method:'post'},
     //入库明细报表(分页)
     InWareHouseDetailReportPage:{url:'/WmsReceiptService/InWareHouseDetailReportPage',method:'post'},
     //调拨统计报表(分页)
     AllocationReportPage:{url:'/WmsReceiptService/AllocationReportPage',method:'post'},
     //调拨明细报表(分页)
     AllocationDetailReportPage:{url:'/WmsReceiptService/AllocationDetailReportPage',method:'post'},

     // develop_Zhang
     // 添加表单数据
     AddTableRecord:{url:'/AddTableRecord/AddTableRecord',method:'post'},
     // 删除表单数据
     DeleteTableRecord:{url:'/DeleteTableRecord/DeleteTableRecord',method:'post'},
     // 发货报表详情
     OutWareHoustDetailReport:{url:'/WmsReceiptService/SendDetail',method: 'post'},

}, config.pgyerApiUrl);
